import React from 'react';
import './Cards.css';
import CardItem from './CardItem';

function Cards() {
  return (
    <div className='cards'>
        <h1>Look into our Cybersecurity Guide</h1>
        <div className='cards__containers'>
            <div className='cards__wapper'>
                <ul className='cards__items'>
                    <CardItem src="images/img-9.jpg"
                     text="Explore our free guide to start in Cybersecurity" 
                     label='Free'
                     path='/services'/>
                    <CardItem src="images/img-9.jpg"
                     text="Explore our free guide to start in Cybersecurity" 
                     label='Free'
                     path='/services'/>
                </ul>
            </div>
        </div>
    </div>
  )
}

export default Cards;
